import React, { Component } from 'react';
import axios from 'axios';
import './App.css';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      modelData: null,
      error: null,
      loading: false,
      modelId: 1  // Set default model ID
    };
  }

  componentDidMount() {
    this.fetchModelData();
  }

  fetchModelData = async () => {
    try {
      this.setState({ loading: true });
      console.log('Fetching model with ID:', this.state.modelId); // Debug log
      const response = await axios.get(`http://127.0.0.1:8000/api/model/?model_id=${this.state.modelId}`);
      console.log('Response received:', response.data); // Debug log
      this.setState({ 
        modelData: response.data,
        loading: false 
      });
    } catch (error) {
      console.log('Error details:', error.response); // More detailed error logging
      this.setState({ 
        error: 'Error fetching data from server',
        loading: false 
      });
      console.error('Error:', error);
    }
  };

  render() {
    const { modelData, error, loading, modelId } = this.state;

    return (
      <div className="App">
        <header className="App-header">
          <h1>CBM GUI Application</h1>
          <h3>Requesting Model ID: {modelId}</h3>

          {loading && <p>Loading...</p>}

          {error && <p style={{ color: 'red' }}>{error}</p>}

          {modelData === null ? (
            <p>No model found with ID: {modelId}</p>
          ) : modelData && (
            <div>
              <h2>Model Data:</h2>
              <pre>{JSON.stringify(modelData, null, 2)}</pre>
            </div>
          )}
        </header>
      </div>
    );
  }
}

export default App;
